function initialMessage(event) {
  // Do we trust the sender of this message?  (might be
  // different from what we originally opened, for example).
  //   console.log(event.data);
  if (event.data && typeof event.data === 'boolean') {
    document.onkeydown = function(e) {
      e = e || window.event;
      document
        .getElementById('frame')
        .contentWindow.postMessage(e.which || e.keyCode, '*');
      // console.log(e.which || e.keyCode);
      if (
        e.keyCode >= 37 ||
        e.keyCode <= 40 ||
        (e.which >= 37 || e.which <= 40)
      ) {
        e.preventDefault(); // prevent the default action (scroll / move caret)
      }
    };
    const data = {
      signers: [
        {
          name: 'John Doe',
          signature:
            '',
          width: '200',
          height: '200'
        },
        {
          name: 'Fred Flinston',
          signature:
            '',
          width: '300',
          height: '300'
        },
        {
          name: 'Mario'
        },
        {
          name: 'Luigi'
        }
      ],
      documentId: 1234,
      timestamp: '201910171000',
      token: '1218fee7a8b50d741f225b617e9eb7a195b487eb3da3db78770839b773d42f5a',
      className: 'test',
      userId: '123'
    };

    document.getElementById('frame').contentWindow.postMessage(data, '*');
  } else if (event.data && typeof event.data === 'object') {
    document.getElementById('output').innerHTML = JSON.stringify(event.data);
  }
  // event.source is popup
  // event.data is "hi there yourself!  the secret response is: rheeeeet!"
}
window.addEventListener('message', initialMessage, false);

